![critical](https://www.gstatic.com/codereviewagent/critical.svg)

`freezed`クラスの定義にいくつか問題があります。
1.  プロパティ名にタイポがあります。`raduisValue` は `radiusValue` が正しいと思われます。
2.  `freezed` を使用する場合、ゲッターを自前でオーバーライドする必要はありません。現在の実装では、生成されたプロパティにアクセスしようとすると `UnimplementedError` がスローされてしまいます。これらのオーバーライドは削除してください。

```
class RadiusSetting with _$RadiusSetting {
  const factory RadiusSetting({
    required double radiusValue,
    required double min,
    required double max,
  }) = _RadiusSetting;
}
```

